// Header.js
import { Link, Outlet } from "react-router-dom";

function Header() {
  return (
    <>
      <h1>Shopping Cart</h1>
      <nav>
        <Link to="/view">View Product Details</Link> |{" "}
        <Link to="/add">Add Product</Link>
      </nav>
      <Outlet />
    </>
  );
}
export default Header;
